import styled from "styled-components";

export const StyledNavbar = styled.nav`
ul{
    display:flex;
    flex-direction:column;
    margin-top:35%;
}
ul li{
    list-style:none;
    text-decoration:none;
    color:white;
    padding:5px;
    opacity:0.6;
}
.vl{
    backgroundp
}
`;
